pragma solidity ^0.4.23;

import './lib/ERC20.sol';
import './lib/Ownable.sol';
import './lib/SafeMath.sol';


contract Library is Ownable {
  using SafeMath for uint256;

  event NewBook(string title);

  mapping (address => bool) 			public librarians;
  mapping (uint => bool) 					public bookInLibrary;
  mapping (uint => address) 			public bookToOwner;

  mapping (address => mapping (uint => bool)) 		public bookCheckedOutTo;
  mapping (uint => BookHistory[]) public bookHistory;


 // create array with book history, append for each action that occurs
  struct BookHistory {
    string action;
    uint256 time;
    address owner;
  }

  struct Book {
    string title;
  }

  BookHistory[] public bookHistories;
  Book[] public books;


  constructor() public {
    owner = msg.sender;
  }

  modifier onlyLibrarian {
    require(msg.sender == owner || librarians[msg.sender]);
    _;
  }

 	function createBook(string _title) public {
    uint256 id = books.push(Book(_title)) - 1;
    bookHistory[id].push(BookHistory("created", now, msg.sender));
    bookToOwner[id] = msg.sender;
    emit NewBook(_title);
 	}

  function addBookToLibrary(uint _bookId) onlyLibrarian public {
  	bookInLibrary[_bookId] = true;
  }

  function removeBookFromLibrary(uint _bookId) onlyLibrarian public {
  	bookInLibrary[_bookId] = false;
	}

  function checkBookOut(uint _bookId, address _bookUser) onlyLibrarian public {
  	require(bookInLibrary[_bookId] == true);
  	bookCheckedOutTo[_bookUser][_bookId] = true;
  }

  function checkBookIn(uint _bookId, address _bookUser) public {
  	require(bookCheckedOutTo[_bookUser][_bookId] == true);
  	bookCheckedOutTo[_bookUser][_bookId] = false;
  }

  function viewBookHistory(uint _bookId, uint _index) public returns(string, uint256, address) {
  	// look up book
  	// return history 
  	return (bookHistory[_bookId][_index].action, bookHistory[_bookId][_index].time, bookHistory[_bookId][_index].owner);
  }

  function addBookHistory(uint _bookId, string _action) public {
  	// change msg.sender to owner
  	bookHistory[_bookId].push(BookHistory(_action, now, bookToOwner[_bookId]));
  }

  function changeBookOwner(uint _bookId, address _newOwner) public  {
  	require(bookToOwner[_bookId] == msg.sender);
  	bookToOwner[_bookId] = _newOwner;
  }
}
